#include <iostream>
#include <string>
#include <vector>
#include <stdio.h>
using namespace std;
int main() {
    char moves[] = "";
    int x=0;
    int y=0;
    for(int i=0;i<sizeof(moves)-1;i++)
    {
        if (moves[i]=='D')
        {
            y-=1;
        }
        if (moves[i]=='U')
        {
            y+=1;
        }
        if (moves[i]=='L')
        {
            x-=1;
        }
        if (moves[i]=='R')
        {
            x+=1;
        }
    }

    cout << x << endl;
    cout << y << endl;
    if (x==0 and y==0)
    {
        cout << "True\n";
    }
    else
    {
        cout << "False\n";
    }
    
    return 0;
}
